import React,{Component} from "react";


class Login extends Component{
    constructor(props){
        super(props);
        this.state={
            passcode:"",    
            roomId:"",
        }
    }
    render(){
        return(
            <React.Fragment>
            <Navigation id="login-page"/>
              <p> join page</p>
            </React.Fragment>
        )
    }
}export default Login;
